import React from "react";
import styled from "styled-components"
import logoUa from "../../images/logoua.png"
import logoEciu from "../../images/logoeciu.png"

const Ua = styled.img`
height: 46px;

  `


export default () => {

    return (
        <div>
            <Ua>
                <img src={logoUa}  />
            </Ua>

            <Eciu>
                <img src={logoEciu} className="w-25" />
            </Eciu>
        </div>
    )

}
